    let params = useParams();
    const rouProps: IWithRouterProps = {
         navigate, params,
    }

    return <Component {...props} id="0" {...rouProps} />;
  }
  return ComponentWithRouterProp;
}
export interface IWithRouterProps {
    navigate: NavigateFunction,
